import { Box, Typography } from "@mui/material";

const NotFound = () => {
  return (
    <Box
      sx={{
        margin: "auto",
        backgroundColor: "#fff",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        borderRadius: "12px",
        width: { sm: "280px", lg: "400px" },
        height: { sm: "180px", lg: "300px" },
        boxShadow: "0px 0px 10px 0px rgba(0,0,0,0.3)",
      }}
    >
      <Typography
        sx={{
          fontSize: { sm: "28px", lg: "34px" },
          fontWeight: "bold",
          color: "#F59256",
          textAlign: "center",
        }}
      >
        404 - Not Found!
      </Typography>
    </Box>
  );
};

export default NotFound;
